import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Injectable({
  providedIn: 'root'
})
export class WeatherService {

  constructor (private http: HttpClient) { }

  getCurrentWeather() {
    const currentWeather = this.http.get<any>('http://api.weatherapi.com/v1/current.json?key=795b320e04e64bbb9aa42005232906&q=46.43,11.85');

    return {
      text: currentWeather.current.text,
    }
  }
}
